import logo from './logo.svg';
import './App.css';
import React, { useState } from 'react';
import { createBrowserRouter,RouterProvider } from 'react-router-dom';
import Cadastro from './components/login/cadastro';
import MovieList from './components/movies/movieList';
import Navbar from './components/navbar/navbar';
import Principal from './routes/principal';
import ErrorPage from './routes/ErrorPage';
import Home from './routes/Home';
import About from './routes/About';
import Contacto from './routes/Contacto';
import Login from './components/login/login';

import {BrowserRouter,Routes,Route} from "react-router-dom"
//<div><MovieList lista={filmes} loginControler={loginControler} login={login}></MovieList></div>
function App() {



  const[ filmes, setFilmes]=useState([])
  const[ verificar, setverificar]=useState(true)
  const[login,setLogin]=useState(true)
  const loginControler=()=>{setLogin(!login)}

  const rotas=createBrowserRouter([{
    path: '/',
    element: <Principal />,
   errorElement: <ErrorPage />,
   children: [
    { path: '/', element:<MovieList  loginControler={loginControler} login={login}></MovieList> },
    { path: '/about', element: <About /> },
    { path: '/contact', element: <Contacto/> },


  ],
  }])



  console.log(filmes)
  return (
    <div className='main'>
       <RouterProvider router={rotas} />

      <BrowserRouter>
        <Routes>
          <Route path="/contacto" element={<Contacto/>}></Route>
          <Route path="/main" element={
            <div>
              <Navbar loginControler={loginControler} login={login}></Navbar>
              <div><MovieList  loginControler={loginControler} login={login}></MovieList></div>
            </div>
          }></Route>
          <Route path="/cadastrar" element={<Cadastro/>}></Route>
          <Route path="/login" element={<Login/>}></Route>

        </Routes>
      </BrowserRouter>



    </div>
  );
}

export default App;
